import React from "react";
import "./Topbar.css";

import logo from "../../logo.png";

const Topbar = () => {
  return (
    <div class="topbar">
      <div class="wrapper">
        <div class="left">
          <a href="#intro" class="logo">
              <img src={logo} alt="logo" style={{ width: "70px", align}} />
          </a>
        </div>
        <h1>Hello</h1>
        <div class="right">World</div>
      </div>
    </div>
  );
};

export default Topbar;
